import React from 'react';
import { StyleSheet} from 'react-native';

export const styles = StyleSheet.create({
  store:{
    marginTop:30,
    height:40,
    width:40,
  },
  img2:{
    marginTop:30,
    height:100,
    width:100,
  },
  buttonContainer:{
    width: 90,
    height: 90,
    backgroundColor: '#9ADAD6',
    borderRadius: 15,
  },
  buttonContainer2:{
    width: 90,
    height: 90,
    backgroundColor: '#196F75',
    borderRadius: 15,
  },
  buttonContainer3:{
    width: 90,
    height: 90,
    backgroundColor: '#FF816B',
    borderRadius: 15,
  },
  buttons:{
    flex: 1,
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
});
